        public void SavedGame_DeserializeSavedGame_Valid()
        {
            var reader = new StringReader(validSaveData);
            var savedGame = SavedGame.DeserializeSavedGame(reader);
            Assert.NotNull(savedGame);
            Assert.NotNull(savedGame.AncientsData);
            Assert.NotNull(savedGame.AncientsData.Ancients);
        }

