        [Fact]
        public void SavedGame_TestConsistency()
        {
            // For other tests, make sure our valid data is the same across tests.
            var saveData = SavedGame.DecodeSaveData(validEncodedSaveData).ReadToEnd();
            Assert.Equal(validSaveData.Length, saveData.Length);
            for (int i = 0; i < validSaveData.Length; i++)
            {
                Assert.Equal(validSaveData[i], saveData[i]);
            }
        }

        [Fact]
        public void SavedGame_IsAndroid()
        {
            Assert.False(SavedGame.IsAndroid(validEncodedSaveData));
            Assert.False(SavedGame.IsAndroid(invalidEncodedSaveDataBadData));
            Assert.False(SavedGame.IsAndroid(invalidEncodedSaveDataBadHash));
            Assert.False(SavedGame.IsAndroid(invalidEncodedSaveDataMissingAntiCheat));

            Assert.True(SavedGame.IsAndroid(validEncodedAndroidSaveData));
            Assert.True(SavedGame.IsAndroid(invalidEncodedAndroidSaveDataNoBrace));
            Assert.True(SavedGame.IsAndroid(invalidEncodedAndroidSaveDataBadJson));
        }

